import ProductList from './ProductList';
import "./Product.css"
import CreateProduct from '../CreateProduct';
function Product() {
	return (
		<><h2>Danh sách sản phẩm</h2>
			<CreateProduct />
			<ProductList />
		</>
	);
}

export default Product;
